import React, { Component } from "react";
import "../../style/adopt_2_info.css";

class AdoptInfo extends Component {
  state = {};

  render() {
    return (
      <React.Fragment>
        <a href="" class="backPage">
          <img src="./img/arrow.png" class="mx-5" alt="回上一頁"></img>
        </a>
        <div class="d-flex col-12">
          <div class="petPic col-8 ">
            <img src="./img/南瓜.jpg" alt=""></img>
          </div>
          <div>
            <div class="col-4 mt-5">
              <p>虎斑</p>
              <p>男生</p>
              <p>2個月大</p>
              <p>已打疫苗</p>
              <p>已除蟲</p>
              <p>目前狀況適合領養</p>
            </div>
            <div class="willingness">
              <button>我有意願領養</button>
            </div>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default AdoptInfo;
